INSERT INTO `field_data_body` (`entity_type`, `bundle`, `deleted`, `entity_id`, `revision_id`, `language`, `delta`, `body_value`, `body_summary`, `body_format`) VALUES
('node', 'article', 0, 1, 1, 'und', 0, 'Dreamland Store is a premier grocery destination designed to cater to all your culinary needs with ease and enjoyment. Established with the vision of providing a one-stop shopping experience, Dreamland Store combines quality, variety, and convenience under one roof.\r\n\r\n\r\n\r\n<iframe src=\"https://www.google.com/maps/embed?pb=!1m18!1m12!1m3!1d15751.486737304751!2d125.9703579941546!3d9.255760651747334!2m3!1f0!2f0!3f0!3m2!1i1024!2i768!4f13.1!3m3!1m2!1s0x3303d4ee719e48d3%3A0x8bc3a8c758839a4e!2sSan%20Juan%2C%20Madrid%2C%20Surigao%20del%20Sur!5e0!3m2!1sen!2sph!4v1717340003320!5m2!1sen!2sph\" width=\"600\" height=\"450\" style=\"border:0;\" allowfullscreen=\"\" loading=\"lazy\" referrerpolicy=\"no-referrer-when-downgrade\"></iframe>', '', 'full_html'),
('node', 'page', 0, 2, 2, 'und', 0, '<blockquote>\r\nOwned by Rosenda Park, Emiliana Ayado, Marilyn Ayado. </blockquote>', '', 'full_html'),
('node', 'article', 0, 3, 3, 'und', 0, '<iframe src=\"https://drive.google.com/file/d/1uEOtG1jlkCn_Am507-IOQ-O8wj7S9kI_/preview\" width=\"800\" height=\"1200\" allow=\"autoplay\"></iframe>', '', 'full_html'),
('node', 'article', 0, 4, 4, 'und', 0, '<iframe src=\"https://drive.google.com/file/d/1YWwo_Y7igZEM5qjJzt1h8stOxXFQrIwj/preview\" width=\"800\" height=\"1200\" allow=\"autoplay\"></iframe>\r\n\r\n<strong> Dried fish is more than just food; it\'s part of the Filipino heritage and everyday life, embodying the resourcefulness and culinary traditions of the Philippines. It is enjoyed by many for its unique taste and is a reminder of the simple yet rich culinary practices of the country. </strong> \r\nAvailable Dried Fish are shown in the picture.', '', 'full_html'),
('node', 'article', 0, 5, 5, 'und', 0, '<iframe src=\"https://drive.google.com/file/d/1qUOMG1M4ifjTssXk-UAgzprmL6_aN8dd/preview\" width=\"800\" height=\"1200\" allow=\"autoplay\"></iframe>\r\n\r\n<strong>Available Canned Goods </strong>\r\n \r\n<ul>\r\nOften packed in tomato sauce or oil, Filipino sardines are a popular and nutritious option for quick meals.\r\nBrands: Ligo, Mega, 555\r\nCorned Beef\r\n\r\nFilipino-style corned beef is typically more finely shredded and can be fried with onions and potatoes.\r\nBrands: Argentina, Purefoods, CDO\r\nMeatloaf (Maling)\r\n\r\nA savory, ready-to-eat canned meat that can be sliced and fried or added to various dishes.\r\nBrands: Maling, CDO\r\nLuncheon Meat\r\n\r\nSimilar to Spam, but often flavored to suit Filipino tastes. Great for breakfast or sandwiches.\r\nBrands: Ma Ling, Swift\r\nPork and Beans\r\n</ul>\r\nA hearty blend of beans and pork in a rich tomato sauce, perfect for a quick, comforting meal.\r\nBrands: Hunt\'s, Libby\'s\r\nBenefits\r\nConvenience: Ready-to-eat or quick-to-prepare, making meal prep easier.\r\nLong Shelf Life: Ideal for stocking up, especially during emergencies.\r\nFlavor: Authentic Filipino taste, bringing the essence of traditional dishes.\r\nUsage\r\nMain Dishes: Serve with rice or bread for a complete meal.\r\nSide Dishes: Complement main courses or enhance other recipes.\r\nSnacks: Quick and tasty option for any time of the day.\r\nFilipino canned goods embody the flavors of the Philippines, offering a practical and delicious way to enjoy traditional dishes.', '', 'full_html'),
('node', 'article', 0, 6, 6, 'und', 0, '<iframe src=\"https://drive.google.com/file/d/1VQxqPP3OKTz7kC24Z3vTV2W0nLKGQhRP/preview\" width=\"800\" height=\"1200\" allow=\"autoplay\"></iframe>', '', 'full_html'),
('node', 'article', 0, 7, 7, 'und', 0, '<iframe src=\"https://drive.google.com/file/d/1uEOtG1jlkCn_Am507-IOQ-O8wj7S9kI_/preview\" width=\"800\" height=\"1200\" allow=\"autoplay\"></iframe>', '', 'full_html'),
('node', 'article', 0, 9, 9, 'und', 0, 'buagas', '', 'filtered_html'),
('node', 'article', 0, 14, 14, 'und', 0, '<em> Thank you for visiting Dreamland Store! We\'re here to assist you with any questions or concerns you may have. Please feel free to reach out to us through any of the following methods: </em>\r\n\r\nCustomer Service Hours:\r\n\r\nMonday to Friday: 9:00 AM - 6:00 PM\r\nSaturday: 10:00 AM - 4:00 PM\r\nSunday: Closed\r\nContact Information:\r\n<ul>\r\nPhone: +639934634\r\nEmail: park@dreamlandstore.com\r\nAddress: National Highway Purok 6, Barangay San Juan\r\nSocial Media:\r\n</ul>\r\n<ul>\r\nFacebook: facebook.com/DreamlandStore\r\nTwitter: twitter.com/DreamlandStore\r\nInstagram: instagram.com/DreamlandStore\r\n</ul>\r\nOnline Support:\r\nVisit our website and use the live chat feature for immediate assistance: www.dreamlandstore.com\r\n\r\nWe look forward to hearing from you and helping make your Dreamland experience magical!', '', 'full_html'),
('node', 'page', 0, 15, 15, 'und', 0, 'nenennen', '', 'filtered_html'),
('node', 'article', 0, 17, 17, 'und', 0, '<iframe src=\"https://drive.google.com/file/d/1oB-rFW5l9WSUWl4HITVW1pwOku7YLxBy/preview\" width=\"800\" height=\"800\" allow=\"autoplay\"></iframe>\r\n\r\n<blockquote> \r\nWelcome to Dreamland Store, your ultimate destination for all your grocery needs! At Dreamland Store, we believe in making your shopping experience as convenient and enjoyable as possible. Whether you\'re stocking up on everyday essentials, searching for gourmet ingredients, or exploring new and exciting products, we\'ve got you covered. Our wide selection of fresh produce, high-quality meats, pantry staples, and specialty items ensures you\'ll find everything you need in one place. Join us at Dreamland Store, where quality meets convenience, and let us turn your grocery shopping into a dream come true! </blockquote>\r\n\r\n', '', 'full_html'),
('node', 'page', 0, 19, 19, 'und', 0, '<strong> Dreamland Store Help Information </strong>\r\n<ul>\r\nContact Us\r\nPhone: +6390267348\r\nEmail: park@dreamlandstore.com\r\nLive Chat: Available 24/7 on our website\r\nStore Hours\r\nMonday to Friday: 9 AM - 6PM\r\nSaturday: 10 AM - 8 PM\r\nSunday: Closed\r\n</ul>\r\n\r\nPayment Methods\r\nCredit/Debit Cards: Gcash, Cash\r\n\r\nIn-Store Assistance: Available upon request\r\nWebsite Accessibility: Our website is designed to be accessible to all customers. <strong> Contact us for any accessibility issues.\r\nFor more detailed information, visit our Help Center. </strong>', '', 'full_html');
